import { useState } from 'react';

function Profile() {
  const [activeTab, setActiveTab] = useState('info');

  // Mock user data - replace with real API data
  const userData = {
    name: "Alex Johnson",
    email: "alex.j@university.edu",
    university: "State University",
    gradYear: "2025",
    avatar: "https://placeholder.com/150",
    bio: "Computer Science major looking for like-minded roommates. I enjoy coding, gaming, and occasional hiking.",
    preferences: {
      lifestyle: ["Early bird", "Clean", "Study-focused"],
      interests: ["Technology", "Gaming", "Outdoor Activities"],
      budget: "$800 - $1200",
      moveInDate: "Fall 2024",
    },
    savedRoommates: [
      {
        id: 1,
        name: "Sarah Smith",
        university: "State University",
        compatibility: "95%",
        image: "https://placeholder.com/100",
      },
      // Add more saved roommates
    ],
    savedBuildings: [
      {
        id: 1,
        name: "The University Commons",
        price: "$800/month",
        image: "https://placeholder.com/100",
      },
      // Add more saved buildings
    ],
  };

  return (
    <div className="pt-[72px] min-h-screen bg-gray-50">
      {/* Profile Header */}
      <div className="bg-gradient-to-br from-blue-600 via-blue-700 to-indigo-800 py-12">
        <div className="container mx-auto px-6">
          <div className="flex flex-col md:flex-row items-center gap-8">
            <img 
              src={userData.avatar} 
              alt={userData.name} 
              className="w-32 h-32 rounded-full border-4 border-white shadow-lg"
            />
            <div className="text-center md:text-left">
              <h1 className="text-4xl font-bold text-white mb-2">{userData.name}</h1>
              <p className="text-blue-100 text-lg">{userData.university} • Class of {userData.gradYear}</p>
            </div>
          </div>
        </div>
      </div>

      {/* Profile Content */}
      <div className="container mx-auto px-6 py-8">
        {/* Navigation Tabs */}
        <div className="flex space-x-4 mb-8 border-b border-gray-200">
          {['info', 'preferences', 'saved'].map((tab) => (
            <button
              key={tab}
              onClick={() => setActiveTab(tab)}
              className={`pb-4 px-4 font-semibold transition-colors duration-300 ${
                activeTab === tab
                  ? 'text-blue-600 border-b-2 border-blue-600'
                  : 'text-gray-500 hover:text-blue-600'
              }`}
            >
              {tab.charAt(0).toUpperCase() + tab.slice(1)}
            </button>
          ))}
        </div>

        {/* Tab Content */}
        <div className="bg-white rounded-xl shadow-lg p-6">
          {/* Personal Information Tab */}
          {activeTab === 'info' && (
            <div className="space-y-6">
              <div>
                <h3 className="text-xl font-semibold text-gray-800 mb-4">About Me</h3>
                <p className="text-gray-600">{userData.bio}</p>
              </div>
              <div>
                <h3 className="text-xl font-semibold text-gray-800 mb-4">Contact Information</h3>
                <div className="space-y-2">
                  <p className="text-gray-600">Email: {userData.email}</p>
                  <button className="text-blue-600 hover:text-blue-700 font-medium">
                    Edit Profile
                  </button>
                </div>
              </div>
            </div>
          )}

          {/* Preferences Tab */}
          {activeTab === 'preferences' && (
            <div className="space-y-6">
              <div>
                <h3 className="text-xl font-semibold text-gray-800 mb-4">Lifestyle</h3>
                <div className="flex flex-wrap gap-2">
                  {userData.preferences.lifestyle.map((item, index) => (
                    <span key={index} className="px-3 py-1 bg-blue-50 text-blue-600 rounded-full text-sm">
                      {item}
                    </span>
                  ))}
                </div>
              </div>
              <div>
                <h3 className="text-xl font-semibold text-gray-800 mb-4">Interests</h3>
                <div className="flex flex-wrap gap-2">
                  {userData.preferences.interests.map((item, index) => (
                    <span key={index} className="px-3 py-1 bg-blue-50 text-blue-600 rounded-full text-sm">
                      {item}
                    </span>
                  ))}
                </div>
              </div>
              <div>
                <h3 className="text-xl font-semibold text-gray-800 mb-4">Housing Preferences</h3>
                <div className="space-y-2 text-gray-600">
                  <p>Budget: {userData.preferences.budget}</p>
                  <p>Move-in Date: {userData.preferences.moveInDate}</p>
                </div>
              </div>
            </div>
          )}

          {/* Saved Items Tab */}
          {activeTab === 'saved' && (
            <div className="space-y-8">
              <div>
                <h3 className="text-xl font-semibold text-gray-800 mb-4">Saved Roommates</h3>
                <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                  {userData.savedRoommates.map((roommate) => (
                    <div key={roommate.id} className="flex items-center gap-4 p-4 bg-gray-50 rounded-lg">
                      <img src={roommate.image} alt={roommate.name} className="w-16 h-16 rounded-full" />
                      <div>
                        <h4 className="font-semibold text-gray-800">{roommate.name}</h4>
                        <p className="text-gray-600">{roommate.university}</p>
                        <span className="text-sm text-blue-600">{roommate.compatibility} Match</span>
                      </div>
                    </div>
                  ))}
                </div>
              </div>

              <div>
                <h3 className="text-xl font-semibold text-gray-800 mb-4">Saved Buildings</h3>
                <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                  {userData.savedBuildings.map((building) => (
                    <div key={building.id} className="flex items-center gap-4 p-4 bg-gray-50 rounded-lg">
                      <img src={building.image} alt={building.name} className="w-16 h-16 rounded-lg object-cover" />
                      <div>
                        <h4 className="font-semibold text-gray-800">{building.name}</h4>
                        <p className="text-gray-600">{building.price}</p>
                      </div>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default Profile;
